window.bookSummaryJSON = "<p>Tia</p> <p>Love.</p> <p>I’m in love with not just one man but three. Three brutally devoted men determined to make me theirs one way or another.</p> <p>Jace, the gentle boy I fell in love with, is no more. In his place is Rage, my lovers’ brother. He’s angry, jealous and brutal.</p> <p>Can he accept me and my relationship, or will his devotion to me tear us apart?</p> <p>And what happens when he uncovers my truth, and my life is thrown into turmoil?</p> <p>Lucas holds secrets, and his determination to keep me is risking everything we’ve built.</p> <p>And Cole? Cole is willing to accept it all just to be with me, even if it means hurting us in the process.</p> <p>What happens when the one thing that means the most to me becomes at risk?</p> <p>Can my men stay devoted and love me when I need them the most, or will they destroy us, unable to accept one another?</p> <p>Our love is brutal, but it’s filled with devotion.</p>"; 
